import React from "react";
import "./styles.css";
import { NavLink } from "react-router-dom";
import backfon from "../../pictures/ba"


const Header = () => {

    return (
       <header className="header">
        <div className="wrapperheader">Title</div>
        <div>Главная</div>
        <div>Фильмы по категориям</div>
        <div>О нас</div>
        <div>Поиск</div>
        <div className="image ">
          <img src={backfon} alt={backfon} />
        </div>
       </header>
       
    )
}
export default Header;
